import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './App.css'


const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <div>
    <h1>Hello, world!</h1>
      <App />
    </div>
  </React.StrictMode>
);
